import React, { Component } from 'react';
import './App.css';
import AuthComponent from './components/AuthComponent';

class App extends Component {
  state = {
    status:''
  }
  getData = (status)=>{
    let s = status;
    console.log(...s)
  }
  render() {
    return (
      <div className="App">
        <AuthComponent sendData={this.getData.bind(this)}/>
      </div>
    );
  }
}

export default App;
